import React from "react";

const Register = () => {
  return (
    <div>
        <form action=""></form>
      name: <input type="text" name="name" />
      <br />
      phone: <input type="number" name="phone" />
      <br />
      email: <input type="text" name="email" />
      <br />
      password: <input type="text" name="password" />
      <br />

      <button></button>
    </div>
  );
};

export default Register;
